    </div>
  );
}*/

function App() {
  return (
    <div>
      <Layout></Layout>
      <Switch>
        <Route path="/" exact>
          <AllMeetupsPage />
        </Route>
        <Route path="/new-meetup">
          <NewMeetupsPage />
        </Route>
        <Route path="/favorites">
          <FavoritesPages />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
